import React from 'react';
import { useNavigate } from 'react-router-dom';

const HeaderWithBackButton = () => {
  const navigate = useNavigate();

  const handleBack = () => {
    navigate(-1); // Navigate back
  };

  return (
    <header className="bg-pink-700 p-4 text-white">
      <button type='button' onClick={handleBack} className="bg-transparent border border-white px-2 py-1 rounded">
        Back
      </button>
    </header>
  );
};

export default HeaderWithBackButton;
